}","keccak256":"0xfc942dae1070fd3e4b9ad5bbc87df7a97607ab5aec5f8a10bacab179a2e02ffb","license":"MIT"},"contracts/abstracts/AERC20.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../interfaces/IERC20.sol";

abstract contract AERC20 is IERC20 {
    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint8 private _decimals;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    constructor(string memory name_, string memory symbol_, uint8 decimals_) {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
    }

    function name() public view virtual returns (string memory) {
        return _name;
    }

    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual returns (uint256) {
        return _balances[account];
    }

    function transfer(address to, uint256 amount) public virtual returns (bool) {
        _transfer(msg.sender, to, amount);

        return true;
    }

    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual returns (bool) {
        require(spender != address(0), "approve to the zero address.");
        require(spender != msg.sender, "approve to same address.");
        require(amount > 0, "approve amount is zero.");

        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);

        return true;
    }

    function transferFrom(address from, address to, uint256 amount) public virtual returns (bool) {
        require(_allowances[from][msg.sender] >= amount, "insufficient allowance.");

        _allowances[from][msg.sender] -= amount;
        _transfer(from, to, amount);

        return true;
    }

    function _transfer(address from, address to, uint256 amount) internal virtual {
        require(from != address(0), "transfer from the zero address.");
        require(to != address(0), "transfer to the zero address.");
        require(from != to, "transfer to same address.");
        require(amount > 0, "transfer amount is zero.");
        require(_balances[from] >= amount, "transfer amount exceeds balance.");

        _balances[from] = _balances[from] - amount;
        _balances[to] += amount;

        emit Transfer(from, to, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "mint to the zero address.");
        require(amount > 0, "mint amount is zero.");

        _totalSupply += amount;
        _balances[account] += amount;

        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "burn from the zero address.");
        require(amount > 0, "burn amount is zero.");
        require(_balances[account] >= amount, "burn amount exceeds balance.");

        _balances[account] -= amount;
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);
    }
}","keccak256":"0x849c1d8bbae2e40ebe5b16fefa40f03da8399b3edf04c450940a808a1907d1c5","license":"MIT"},"contracts/abstracts/AERC20Extendable.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "./AERC20.sol";

abstract contract AERC20Extendable is AERC20 {
    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual;
    function _afterTokenTransfer(address from, address to, uint256 amount) internal virtual;

    constructor(string memory name_, string memory symbol_, uint8 decimals_) AERC20(name_, symbol_, decimals_) {

    }

    function _transfer(address from, address to, uint256 amount) internal virtual override {
        _beforeTokenTransfer(from, to, amount);
        super._transfer(from, to, amount);
        _afterTokenTransfer(from, to, amount);
    }

    function _mint(address account, uint256 amount) internal virtual override {
        _beforeTokenTransfer(address(0), account, amount);
        super._mint(account, amount);
        _afterTokenTransfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual override {
        _beforeTokenTransfer(account, address(0), amount);
        super._burn(account, amount);
        _afterTokenTransfer(account, address(0), amount);
    }
}","keccak256":"0xc6fcfe531952da13341887761b57040cf22f803ccd1d7af56aced2efcd8cb7be","license":"MIT"},"contracts/abstracts/AERC20Pausable.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "./AERC20Extendable.sol";
import "./APausable.sol";

abstract contract AERC20Pausable is AERC20Extendable, APausable {
    constructor(string memory name_, string memory symbol_, uint8 decimals_) AERC20Extendable(name_, symbol_, decimals_) APausable() {}

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual override {
        require(!paused(), "contract is paused.");
    }

    function _afterTokenTransfer(address from, address to, uint256 amount) internal virtual override {

    }
}","keccak256":"0x149f7018d2a80204a7c60a70a36ab6e43e710630a35e6e8fb87ab68b823cdb78","license":"MIT"},"contracts/abstracts/AOwnable.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../interfaces/IOwnable.sol";

abstract contract AOwnable is IOwnable {
    address private _owner;

    modifier onlyOwner() {
        require(_owner == msg.sender, "Ownable: caller is not the owner.");
        _;
    }

    constructor() {
        _owner = msg.sender;
    }

    function owner() public view virtual returns (address) {
        return _owner;
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");

        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}","keccak256":"0x7d64a4d06737e8d5ddab2846e752f7884b5288721d4168f97c224192a9fef04f","license":"MIT"},"contracts/abstracts/APausable.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../interfaces/IPausable.sol";
import "./AOwnable.sol";

abstract contract APausable is IPausable, AOwnable {
    bool private _paused;

    modifier whenNotPaused() {
        require(!_paused, "contract paused.");
        _;
    }

    constructor() AOwnable() {
    }

    function paused() public view virtual returns (bool) {
        return _paused;
    }

    function pause() public virtual onlyOwner {
        _paused = true;
        emit Paused(msg.sender);
    }

    function unPause() public virtual onlyOwner {
        _paused = false;
        emit UnPaused(msg.sender);
    }
}","keccak256":"0x485e3da2b986be5f1b3775d4d550b31ed118cecb06569156056b2dccee1e8a18","license":"MIT"},"contracts/interfaces/IERC20.sol":{"content":"// SPDX-License-Identifier: MIT
